async function appendDateInputs(sQuery) {


  // Regular expression to match date strings in the format YYYY-MM-DD
  const dateRegex = /\d{4}-\d{2}-\d{2}/g;

  // Function to replace the matched date strings with modified versions
  function replaceDateWithModified(match) {
    return "datetime'" + match + "T00:00:00'";
  }

  // change dates to epoch date format
  const modifiedUrl = sQuery.replace(dateRegex, replaceDateWithModified);
  return modifiedUrl;


}
